-- ----------------------------
-- Procedure structure for proc_friend_rollback
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_friend_rollback`;
DELIMITER ;;
CREATE DEFINER=`tomeetuser`@`%` PROCEDURE `proc_friend_rollback`(in p_owner_id bigint,in p_friend_id bigint)
BEGIN
START TRANSACTION;
	delete from friend_connection where (owner=p_owner_id and friend=p_friend_id) or (owner=p_friend_id and friend=p_owner_id);
delete from friend_invitation where (owner=p_owner_id and friend=p_friend_id) or (owner=p_friend_id and friend=p_owner_id);
	commit;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for proc_luck_draw_rollback
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_luck_draw_rollback`;
DELIMITER ;;
CREATE DEFINER=`tomeetuser`@`%` PROCEDURE `proc_luck_draw_rollback`(in p_user_id bigint)
inner_block:BEGIN
declare v_sum_money int;
declare v_count_draw int;
START TRANSACTION;  
select sum(a.money) into v_sum_money from aug_activity_luck_draw a where a.user_id=p_user_id;
select count(1) into v_count_draw from aug_activity_luck_draw a where a.user_id=p_user_id;
if(v_sum_money=0 || v_count_draw=0) then
	leave inner_block;
end if;
delete from aug_activity_luck_draw where user_id=p_user_id;
delete from transaction_details where description='抽奖获取' and user=p_user_id;
update aug_activity_all_prize_money set all_money=(all_money+v_sum_money) ,join_member=(join_member-10*v_count_draw);
update user set amount=(amount-v_sum_money) where id=p_user_id;
commit;
end inner_block
;;
DELIMITER ;

-- ----------------------------
-- Function structure for distance_calc
-- ----------------------------
DROP FUNCTION IF EXISTS `distance_calc`;
DELIMITER ;;
CREATE DEFINER=`tomeetuser`@`%` FUNCTION `distance_calc`( longitude1 double,  latitude1 double, longitude2 double,latitude2 double) RETURNS double
BEGIN  
  DECLARE PI double;
  DECLARE R int;
  DECLARE x double;
  DECLARE y double;
  DECLARE distance double;
	set PI=3.14159265358979323;
	set R=6371229;
	set x = (longitude2 - longitude1) * PI * R * cos(((latitude1 + latitude2) / 2) * PI / 180) / 180;
	set	y = (latitude2 - latitude1) * PI * R / 180;
	set	distance = pow(POW(x,2)+POW(y,2),0.5);
	return distance/1000;
END
;;
DELIMITER ;
SET FOREIGN_KEY_CHECKS=1;
